const Contacts = [];
const contactReducer = (state = { Contacts }, action) => {
  switch (action.type) {
    case "ADD-Contact":
      return {
        Contacts: [...Contacts, Contacts.push(data)],
      };

    default:
      break;
  }
};
export default contactReducer;
